    function setSizeSMALL() public {
        choice=size.SMALL;
    }
    function setSizeMEDIUM() public{
        choice=size.MEDIUM;
    }
    function setSizeBIG () public{
        choice= size.BIG;
    }

    function getSize() public view returns(size){
        return choice;
    }
}

